import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { TripsProvider } from './context/TripsContext';
import { BrowserRouter as Router } from 'react-router-dom';

ReactDOM.render(
  <TripsProvider>
    <Router>
      <App />
    </Router>
  </TripsProvider>,
  document.getElementById('root')
);
